import React, { useState, useEffect } from 'react';
import "./Inicio.css";
import Menu from "../../Menu";
import Header from '../../Header';
import Calendar from './Calendar';
import axios from 'axios';
import "../../Fonts.css";

const Inicio = () => {
  const colorCode = 2;
  const [appointments, setAppointments] = useState([]);
  const crp = "12398472633";

  useEffect(() => {
    axios.get(`http://192.168.0.9:8080/appointment/` + crp)
      .then(response => {
        setAppointments(response.data.object);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="container">
      <div className="item item1-1" style={{ width: '93%' }}><Menu /></div>
      <div className="item item1-2"><Header/></div>
      <div className="item item2-1"><Calendar colorCode={colorCode} appointments={appointments} /></div>
    </div>
  );
};

export default Inicio;
